(function(){
    try {
        if (!!QuantumMetricAPI) {
            QuantumMetricAPI.addEventListener("api", function(api, type) {
                var url = api.url;
                if (!!url && url.indexOf("/api/curtis/v1/public/mfa-status") > -1) {
                    if (!!api.xhr) {
                        try {
                            if (api.status == 200){
                                QuantumMetricAPI.sendEvent(49,0)
                            } else if (api.status > 399) {
                    QuantumMetricAPI.sendEvent(50,0,api.status)
                            }                        
                        } catch (err) {};
                    };
                };
            });
        }
    } catch (err) {};
})();

// Transfer Source and Destination

(function() {
        if (!!QuantumMetricAPI && !!QuantumMetricAPI.sendEvent && !!window.location.href.indexOf('/transfers/') > -1) {
            try {
                document.addEventListener('click',function(e){
                    if(e.target.innerText === "Schedule Transfer") {
                        if (!!document.querySelector('label[for="from"] select option[aria-selected="true"]') && document.querySelector('label[for="from"] select option[aria-selected="true"]').innerText.indexOf('Aspiration') > -1){
                            QuantumMetricAPI.sendEvent(58, 0, "Internal");                           
                        } else if (!!document.querySelector('label[for="from"] select option[aria-selected="true"]') && document.querySelector('label[for="from"] select option[aria-selected="true"]').innerText.indexOf('Aspiration') === -1){
                            QuantumMetricAPI.sendEvent(58, 0, "External");  
                        }
                        if (!!document.querySelector('label[for="to"] select option[aria-selected="true"]') && document.querySelector('label[for="to"] select option[aria-selected="true"]').innerText.indexOf('Aspiration') > -1){
                            QuantumMetricAPI.sendEvent(59,0,"Internal");                          
                        } else if (!!document.querySelector('label[for="to"] select option[aria-selected="true"]') && document.querySelector('label[for="to"] select option[aria-selected="true"]').innerText.indexOf('Aspiration') === -1){
                            QuantumMetricAPI.sendEvent(59,0,"External");
                        }
                    }
                 });
            } catch (err) {};
        }
})();

// (8-6-19) Capture failed deposits based off of API response code > 399
(function(){
    try {
        if (!!QuantumMetricAPI) {
            QuantumMetricAPI.addEventListener("api", function(api, type) {
                try {
                    var reg = new RegExp(/api\/v1\/product\/applications\/\d*\/recurring/, 'i');
                    if (!!api.url && reg.test(api.url)) {
                        if (!!api.xhr) {
                                if (api.status > 399){
                                    var response = JSON.parse(api.xhr.responseText);
                                    if (!!response) {
                                        QuantumMetricAPI.sendEvent(194,0,response.message)
                                    }
                                }              
                        } 
                    };
                } catch (err) {};
            });
        }
    } catch (err) {};
})();

// Planout Integration

(function() {
    setTimeout(function(){
        try {
            var planoutObj = JSON.parse(localStorage.getItem('planout_assignments'));
            var rootKey = Object.keys(planoutObj)[0];
            var secondLevel = Object.keys(planoutObj[rootKey]);
            if (!!planoutObj && !!rootKey && !!secondLevel) {
                for (i = 0; i < secondLevel.length; i++) {
                    var secondLevelKey = secondLevel[i];
                    var thirdLevel = Object.keys(planoutObj[rootKey][secondLevelKey]);
                    if (!!secondLevelKey && !!thirdLevel) {
                        for (j = 0; j < thirdLevel.length; j++) {
                            var thirdLevelKey = thirdLevel[j];
                            var thirdLevel = planoutObj[rootKey][secondLevelKey][thirdLevelKey];
                                if (!!thirdLevel.Bucket && !!thirdLevelKey && !!thirdLevel) {
                                    // send event
                                    window.QuantumMetricAPI.sendEvent(209, 0, [thirdLevelKey, thirdLevel.Bucket].join(" | "))
                                }
                        }
                    }
                };
            }
        } catch (err) {};    
    }, 1000)
})();;
